import React, { useEffect, useState } from "react";
import { getProvider, getMyNFTs } from "../contractUtils";
import { useNavigate } from "react-router-dom";

export default function Inventory() {
  const [address, setAddress] = useState("");
  const [cars, setCars] = useState([]);
  const [houses, setHouses] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    async function fetchData() {
      const provider = await getProvider();
      const signer = provider.getSigner();
      const userAddress = await signer.getAddress();
      setAddress(userAddress);
      const nfts = await getMyNFTs(userAddress);
      setCars(nfts.filter(nft => nft.itemType === "car"));
      setHouses(nfts.filter(nft => nft.itemType === "house"));
    }
    fetchData();
  }, []);

  return (
    <div>
      <div style={{ padding: 20, fontWeight: "bold", fontSize: 28 }}>Owned Properties</div>
      <div style={{ textAlign: "center", marginTop: 24 }}>
        <h1>Owned Properties</h1>
        <div>View details of your owned houses and car</div>
        <div style={{ margin: 20 }}>
          <button onClick={() => {}} style={{ marginRight: 10 }}>Houses</button>
          <button onClick={() => {}}>Car</button>
          <button onClick={() => navigate("/transfer")} style={{ marginLeft: 40, background: "#000", color: "#fff", fontWeight: "bold" }}>
            Transfer
          </button>
        </div>
      </div>
      <div style={{ margin: "40px 100px" }}>
        <div style={{ fontSize: 22, fontWeight: "bold" }}>Houses</div>
        <div style={{ display: "flex", gap: 24, flexWrap: "wrap" }}>
          {houses.map((nft) => (
            <div key={nft.tokenId} style={{ border: "1px solid #eee", borderRadius: 8, padding: 24, minWidth: 250, marginTop: 20 }}>
              <div style={{ fontWeight: "bold" }}>{nft.name}</div>
              <div>Worth: ${nft.value}</div>
              <div>Purchased: {nft.purchaseDate}</div>
              <div>Address: {nft.addr}</div>
              <div style={{ fontSize: 12, color: "#888" }}>NFT ID: {nft.tokenId}</div>
            </div>
          ))}
        </div>
        <div style={{ fontSize: 22, fontWeight: "bold", marginTop: 32 }}>Car</div>
        <div style={{ display: "flex", gap: 24, flexWrap: "wrap" }}>
          {cars.map((nft) => (
            <div key={nft.tokenId} style={{ border: "1px solid #eee", borderRadius: 8, padding: 24, minWidth: 250, marginTop: 20 }}>
              <div style={{ fontWeight: "bold" }}>{nft.name}</div>
              <div>Worth: ${nft.value}</div>
              <div>Purchased: {nft.purchaseDate}</div>
              <div>VIN: {nft.vin}</div>
              <div style={{ fontSize: 12, color: "#888" }}>NFT ID: {nft.tokenId}</div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
